import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import styles from './RequestDetail.module.css';
import axios from 'axios';

const RequestDetail = () => {
  const { requestId } = useParams();
  const navigate = useNavigate();

  const [request, setRequest] = useState(null);
  const [blockAdmins, setBlockAdmins] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios.get(`http://localhost:8080/requests/${id}`)
      .then(response => {
        setRequest(response.data);
        const block = response.data.block;
        return axios.get(`http://localhost:8080/users/block/${block}`);
      })
      .then(adminResponse => {
        if (adminResponse.data && adminResponse.data.length > 0) {
          setBlockAdmins(adminResponse.data);
        }
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching request or admin:', error);
        setError('Failed to fetch request details');
        setLoading(false);
      });
  }, [requestId]);

  if (loading) return <div className={styles.loading}>Loading...</div>;
  if (error) return <div className={styles.error}>{error}</div>;
  if (!request) return <div className={styles.error}>Request not found</div>;

  return (
    <div className={styles.requestDetail}>
      <h2>Request Details</h2>

      <div className={styles.detailGrid}>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Request ID:</span>
          <span className={styles.detailValue}>{request.requestId}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>User Name:</span>
          <span className={styles.detailValue}>{request.userName}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Block:</span>
          <span className={styles.detailValue}>{request.block}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Flat Number:</span>
          <span className={styles.detailValue}>{request.flatNumber}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Service Type:</span>
          <span className={styles.detailValue}>{request.serviceType}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Description:</span>
          <span className={styles.detailValue}>{request.description}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Request Date:</span>
          <span className={styles.detailValue}>{request.requestDate}</span>
        </div>
        <div className={styles.detailItem}>
          <span className={styles.detailLabel}>Status:</span>
          <span className={styles.detailValue}>{request.status}</span>
        </div>
      </div>

      {blockAdmins.length > 0 && (
        <div className={styles.adminSection}>
          <h3>Block Administrator(s)</h3>
          {blockAdmins.map((admin, index) => (
            <div key={index} className={styles.adminCard}>
              <div className={styles.detailGrid}>
                <div className={styles.detailItem}>
                  <span className={styles.detailLabel}>Name:</span>
                  <span className={styles.detailValue}>{admin.name}</span>
                </div>
                <div className={styles.detailItem}>
                  <span className={styles.detailLabel}>Email:</span>
                  <span className={styles.detailValue}>
                    <a href={`mailto:${admin.email}`} className={styles.contactLink}>{admin.email}</a>
                  </span>
                </div>
                <div className={styles.detailItem}>
                  <span className={styles.detailLabel}>Phone:</span>
                  <span className={styles.detailValue}>
                    <a href={`tel:${admin.mobileNo}`} className={styles.contactLink}>{admin.mobileNo}</a>
                  </span>
                </div>
                <div className={styles.detailItem}>
                  <span className={styles.detailLabel}>Block:</span>
                  <span className={styles.detailValue}>{admin.block}</span>
                </div>
              </div>
              <hr />
            </div>
          ))}
        </div>
      )}

      <button className={styles.backButton} onClick={() => navigate(-1)}>Back</button>
    </div>
  );
};

export default RequestDetail;
